import React from 'react';
import UserApp from './UserApp';
import AdminApp from './AdminApp';

const buildType = process.env.REACT_APP_BUILD_TYPE || 'user';

function App() {
  if (buildType === 'admin') {
    return <AdminApp />;
  }
  
  return <UserApp />;
}

export default App;
